description:
Here it is y'all! The ENTIRE collection of Ultimate Spider-Man comics! Up-to-date! From Issue 01 to Issue 1.5 (Yes, there WAS an issue 1.5) to Issue 128. And guess what? This torrent includes Ultimate Spider-Man Annual (Issue 01 to 03), Ultimate Spider-Man Super Special, The Ultimates 3 (Issue 01 and 02), Ultimate Marvel Team-Up (Issue 01 to 16) and Ultimate Six (Issue 01 to 07)! I've also included CDisplay Sequential Image Reader in a RAR file. You'll need it to read the comics. UNRAR the file, run 'setup.exe' and you're done!


NOTE:

1.) USM Annual 01 should be read after you complete Issue 86 and before you start Issue 87.

2.) USM Annual 02 should be read after you complete Issue 105 and before you start Issue 106.

3.) I know UltiMarvTeamUp says 'read after 21' and UltiSix says 'read after 46' but I didn't find the necessity to do either.

4.) If you find any issue missing from the collection, please inform me asap and I'll try to get it for you asap.

5.) Any more questions?


